//create custom slider function
function cst_slider(container) {
  gsap.registerPlugin(ScrollTrigger, Draggable);

  let sl_items = container.querySelectorAll(".slide_item"),
    thumb_item = container.querySelectorAll(".cst_thumb_item"),
    thumb_selector = container.querySelector(".thumb_selector");

  let sl_items_parent = sl_items[0].parentElement,
    thumb_item_parent = thumb_item[0].parentElement;

  let prev_sl = null,
    current_sl = 0;

  thumb_item_parent.setAttribute(
    "style",
    `--thumbHeight:calc(75vh / ${thumb_item.length})`
  );
  gsap.set(thumb_selector, {
    height: thumb_item[0].clientHeight,
    y: 0,
    opacity: 1,
  });
  thumb_item[0].classList.add("active");
  gsap.set(sl_items, {
    opacity: 0,
    yPercent: 100,
  });
  gsap.set(sl_items[0], {
    opacity: 1,
    yPercent: 0,
  });
  sl_items[0].classList.add("active");

  function setThumbSelector(el) {
    gsap.to(thumb_selector, {
      height: el.clientHeight,
      y: el.offsetTop,
      ease: "circ.out",
      duration: 0.8,
      opacity: 1,
    });
  }

  thumb_item.forEach((thumb, i) => {
    thumb.addEventListener("click", function (e) {
      prev_sl = current_sl;
      current_sl = i;

      if (prev_sl != null && prev_sl != current_sl) {
        thumb_item[prev_sl].classList.remove("active");
        thumb_item[current_sl].classList.add("active");
        sl_items[prev_sl].classList.remove("active");
        sl_items[current_sl].classList.add("active");

        setThumbSelector(thumb);
        let sl_tl = gsap.timeline();
        sl_tl
          .to(sl_items[prev_sl], {
            yPercent: prev_sl > current_sl ? 100 : -100,
            duration: 0.8,
            ease: "ease-in",
            onStart: () => {
              sl_items[prev_sl].classList.add("animation");
            },
            onComplete: () => {
              sl_items[prev_sl].classList.remove("animation");
            },
          })
          .set(
            sl_items[current_sl],
            {
              opacity: 0,
            },
            "<"
          )
          .set(
            sl_items[current_sl],
            {
              yPercent: prev_sl > current_sl ? -100 : 100,
            },
            "<"
          )
          .to(
            sl_items[current_sl],
            {
              opacity: 1,
              yPercent: 0,
              duration: 0.8,
              ease: "ease-out",
              onStart: () => {
                sl_items[current_sl].classList.add("animation");
              },
              onComplete: () => {
                sl_items[current_sl].classList.remove("animation");
              },
            },
            "<"
          )
          .set(sl_items[prev_sl], {
            opacity: 0,
          });
      }
    });
  });
}

// init slider
let cst_sliders = document.querySelectorAll(".custom_slider_container");
if (cst_sliders.length) {
  cst_sliders.forEach((element) => {
    cst_slider(element);
  });
}
